export const fetchUserPortfolio = createAsyncThunk(
    'userPortfolio/fetchUserPortfolio',
    async (token, thunkAPI) => {
      console.log('fetchUserPortfolio thunk called with token:', token);
      try {
        const response = await fetchPortfolioData(token);
        console.log('fetchUserPortfolio response:', response);
        return response; // Assuming the response is the data object itself
      } catch (error) {
        console.error('fetchUserPortfolio error:', error);
        if (!error.response) {
          // Handle errors without a response (network errors, timeouts, etc.)
          return thunkAPI.rejectWithValue({ message: error.message || 'An unknown error occurred' });
        }
        // Handle HTTP errors
        return thunkAPI.rejectWithValue(error.response.data);
      }
    }
  );
